import React from 'react';
import { Link } from 'react-router-dom';
import { useForm } from 'react-hook-form';
import FormModel from '../Form/FormModel/FormModel';

interface Field {
    type: string;
    placeholder: string;
    name: string;
    error?: string;
}

const fields: Field[] = [
    { type: "email", placeholder: "Digite seu email", name: "email", error: "Insira uma valor válido para Email!" },
];

const FormLogin: React.FC = () => {
    


    const submitForm = (data: any) => { 
        
        window.location.reload();

    };

    return (
        <>

        <FormModel buttonText={'Login'} onSubmit={handleSubmit(submitForm)} fields={fields} />


            <hr />

            <div className="flex flex-col gap-3 my-5">
                <a
                    className="w-full text-center p-4 font-medium border border-black 
                    rounded-xl hover:bg-black hover:text-white text-heading-blue-secondary text-2xl flex justify-center gap-2"
                    href=""
                >
                    <img src="/Google.svg" className="w-7" alt="Google Icon" /> Continue with Google 
                </a>
                <p className="text-gray-600 text-lg">
                    Não tem conta ainda? <Link className="hover:underline" to="/RegisterData">Cadastre-se</Link>
                </p>
            </div>
        </>
    );
}

export default FormLogin;
